$(function(){
	
	$("#sub").on("click", function(){
			var form = new FormData($('#fm')[0]);
			$.ajax({
				url:appServer + "/bops/user/batchimportintendeduser.htm",
				type: "POST",
				data: form,
				processData: false,  
	            contentType: false,
				beforeSend:function(){
					loadIndex = layer.load(1);
				},
				success:function(res){
					layer.close(loadIndex);
					if(res.meta.success){
						layer.alert("正在添加中，完成后将发送结果邮件，请注意查收！");
					}else{
						layer.alert(res.meta.errorInfo);
					}
				},
				error:function(){
					layer.close(loadIndex);
					layer.msg("网络错误！");
				}
			});
			
		});
	
	$("#tempmark").on("click", function(){
		layer.open({
			  type: 1,
			  title: false,
			  closeBtn: 0,
			  area: '602px',
			  skin: 'layui-layer-nobg', //没有背景色
			  shadeClose: true,
			  content: '<img src="data:image/png;base64,">'
		});
	});
});